import {Types} from '../actions/date';
import moment from 'moment';
const INITIAL_STATE = [
  {
    date: moment(),
  }
]


export default function dateReducer(state =  INITIAL_STATE, action){
  switch (action.type){
    case Types.CHANGE_DATE:{
      return {
        ...state,
        date: action.payload
      }
    }
    default:
      return state  ;
  }
}
